import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'ngApp';
}
<style>

  :host {
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
    font-size: 14px;
    color: #333;
    box-sizing: border-box;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
  }

  ul {
    list-style: none;
  }

  li {
    display: inline-block;
    margin-right: 15px;
  }


  h1,
  h2,
  h3,
  h4,
  h5,
  h6 {
    margin: 8px 0;
  }

  p {
    margin: 0;
  }

  .spacer {
    flex: 1;
  }

  .toolbar {
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 100px;
    display: flex;
    align-items: center;
    background-color: #1976d2;
    color: white;
    font-weight: 600;
  }

  .toolbar img {
    margin: 0 16px;
  }

  .toolbar #insta-logo {
    height: 40px;
    margin: 0 8px;
  }

  .toolbar #insta-logo:hover {
    opacity: 0.8;
  }

  .content {
    display: flex;
    margin: 82px auto 32px;
    padding: 0 16px;
    max-width: 960px;
    flex-direction: column;
    align-items: center;
    background-color: #1972d1;
    width: 100%;
  }


  footer {
    margin-top: 8px;
    display: flex;
    align-items: center;
    line-height: 20px;
  }

  footer a {
    display: flex;
    align-items: center;
  }

  @media (min-width: 320px) and (max-width: 999px) {
    .navBar {
      height: fit-content;
      margin: 5px;
      padding: 1px;
      background-color: #1972d1;
      border-radius: 30px;
    }

    .toolbar {
      height: fit-content;
      background-color: #1972d1;
      width: fit-content;
    }

    .header {
      height: fit-content;
      width: 100%;
      position: absolute;
    }

    .content {
      height: fit-content;
    }
  }

  @media (min-width: 800px) {
    .navBar {
      padding: 2px;
      background-color: #1972d1;
      border-radius: 30px;
    }
  }

  button.round {
    padding: 5px;
    background-color: #f6ff00;
    border-radius: 20px;
  }



</style>
<!-- Toolbar -->
<header>
<div class="toolbar" role="banner">
  <a href="https://skauting.sk/">
  <img
    width="40"
    alt="Sk skauting logo"
    src="data:image/svg+xml;base64,"
  />
</a>

  <span>4. Zbor Dzivé Labute</span>
    <div class="spacer"></div>

    <div class="navBar">
      <nav> 
        <ul>
          <li><a routerLink="/home"><button class="round">Home</button></a></li>
          <li><a routerLink="/articles"><button class="round">Akcie</button></a></li>
          <li><a routerLink="/contact"><button class="round">Kontakt</button></a></li>
          <li><a routerLink="/login"><button class="round">Login</button></a></li>
        </ul>
      </nav>
    </div>

    <div class="spacer"></div>
    <a aria-label="Dzivé labute na Instagrame" target="_blank" rel="noopener" href="https://instagram.com/dzive_labute" title="Instagram">
      <svg id="insta-logo" height="24" data-name="Logo" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 600 600">
        <rect width="800" height="800" fill="none"/>
        <path d="M224.1 141c-63.6 0-114.9 51.3-114.9 114.9s51.3 114.9 114.9 114.9S339 319.5 339 255.9 287.7 141 224.1 141zm0 189.6c-41.1 0-74.7-33.5-74.7-74.7s33.5-74.7 74.7-74.7 74.7 33.5 74.7 74.7-33.6 74.7-74.7 74.7zm146.4-194.3c0 14.9-12 26.8-26.8 26.8-14.9 0-26.8-12-26.8-26.8s12-26.8 26.8-26.8 26.8 12 26.8 26.8zm76.1 27.2c-1.7-35.9-9.9-67.7-36.2-93.9-26.2-26.2-58-34.4-93.9-36.2-37-2.1-147.9-2.1-184.9 0-35.8 1.7-67.6 9.9-93.9 36.1s-34.4 58-36.2 93.9c-2.1 37-2.1 147.9 0 184.9 1.7 35.9 9.9 67.7 36.2 93.9s58 34.4 93.9 36.2c37 2.1 147.9 2.1 184.9 0 35.9-1.7 67.7-9.9 93.9-36.2 26.2-26.2 34.4-58 36.2-93.9 2.1-37 2.1-147.8 0-184.8zM398.8 388c-7.8 19.6-22.9 34.7-42.6 42.6-29.5 11.7-99.5 9-132.1 9s-102.7 2.6-132.1-9c-19.6-7.8-34.7-22.9-42.6-42.6-11.7-29.5-9-99.5-9-132.1s-2.6-102.7 9-132.1c7.8-19.6 22.9-34.7 42.6-42.6 29.5-11.7 99.5-9 132.1-9s102.7-2.6 132.1 9c19.6 7.8 34.7 22.9 42.6 42.6 11.7 29.5 9 99.5 9 132.1s2.7 102.7-9 132.1z" fill="#fff"/>

      </svg>
    </a>
</div>
<a href="https://skauting.sk"></a>
</header>


<!-- Content -->
<div class="content" role="main">

  <router-outlet></router-outlet>


  <!-- Footer -->
  <footer>
      Made with Angular and NodeJS&nbsp;<br>
      Creator: Radoslav&nbsp;
  </footer>


</div>
